import resume from "../images/Resume.jpg";
import FileViewer from "react-file-viewer";
import React from 'react';
import Iframe from 'react-iframe';

export default function ProjectsPage() {
    return (
        <Iframe url="https://drive.google.com/file/d/1dEIYUFbjzTtQ4UAp8RmYekqcU1C0fR3j/view?usp=sharing"
                src="../../images/Resume_Latest.pdf"
                id="myId"
                width="1000px"
                height="1000px"
                className="myClassname"
                display="initial"
                position="relative"/>
    );
}
